import React from 'react'
import { Star, StarFill } from 'react-bootstrap-icons'

export const Job = ({job}) => {

    const starredHandler = (e) => {
        console.log(e)
    }

    return ( 
        <tr>
            <td>{job.company}</td>
            <td>{job.position}</td>
            <td>{job.link}</td>
            <td>{job.status}</td>
            <td><a onClick={starredHandler}>{job.starred ? <StarFill /> : <Star />}</a></td>
            <td>{job.notes}</td>
        </tr>
    )
}
